import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg p-4">
        <a className="navbar-brand d-flex justify-content-center" href="/">
        <h1>Peoples with Meeples</h1>
        </a>

        <ul className="list-inline d-flex justify-content-center">
          <li className="list-inline-item"><a href="/" className="link">Home</a></li>
          <li className="list-inline-item"><a href="/signup" className="link">Sign Up</a></li>
          <li className="list-inline-item"><a href="/login" className="link">Log In</a></li>
          <li className="list-inline-item"><a href="/profile" className="link">Profile</a></li>
          <li className="list-inline-item"><a href="/guild" className="link">Guild</a></li>
          <li className="list-inline-item"><a href="/search" className="link">Search</a></li>
        </ul>


    </nav>
  );
}

export default Nav;
